<h6 style=""font-family:Cambria;"">A ""modern-day"" <a href=""https://en.wikipedia.org/wiki/Lenovo"">Lenovo</a> laptop</h6>

<br />

<p style=""font-family:Cambria;"">
    A <strong>laptop computer </strong>(also shortened to just <strong>laptop</strong>; or called a <strong>notebook computer</strong>) is a small, portable <a href=""https://en.wikipedia.org/wiki/Personal_computer"">personal computer </a>(PC) with a ""<a href=""https://en.wikipedia.org/wiki/Clamshell_design"">clamshell</a");
            WriteLiteral(@">"" form factor, typically having a thin <a href=""https://en.wikipedia.org/wiki/Liquid-crystal_display"">LCD</a> or <a href=""https://en.wikipedia.org/wiki/Light-emitting_diode"">LED</a> <a href=""https://en.wikipedia.org/wiki/Computer_monitor"">computer screen</a> mounted on the inside of the upper lid of the <a href=""https://en.wikipedia.org/wiki/Clamshell_design"">clamshell</a> and an <a href=""https://en.wikipedia.org/wiki/Computer_keyboard"">alphanumeric keyboard</a> on the inside of the lower lid. The clamshell is opened up to use the computer. Laptops are folded shut for transportation, and thus are suitable for <a href=""https://en.wikipedia.org/wiki/Mobile_computing"">mobile use</a>.Its name comes from <a href=""https://en.wikipedia.org/wiki/Lap"">lap</a>, as it was deemed to be placed on a person's lap when being used. Although originally there was a distinction between laptops and notebooks (the former being bigger and heavier than the latter), as of 2014, there is often no longer any difference.Laptops are com");
