</p>

<h2 style=""font-family:Cambria;"">Terminology Variants</h2>
<hr />

<p style=""font-family:Cambria;"">
    The terms <em>laptop</em> and <em>notebook</em> are used interchangeably to describe a portable computer in English, although in some parts of the world one or the other may be preferred. There is some question as to the original etymology and specificity of either termâ€”the term <em>laptop</em> appears to have been coined in the early 1980s to describe a mobile computer which could be used on one's lap, and to distinguish these devices from earlier, much heavier, <a href=""https://en.wikipedia.org/wiki/Portable_computer"">portable computers</a> (informally called ""luggables""). The term ""notebook"" appears to have gained currency somewhat later as manufacturers started producing even smaller portable devices, further reducing their weight a");
            WriteLiteral(@"nd size and incorporating a display roughly the size of <a href=""https://en.wikipedia.org/wiki/ISO_216#A_series"">A4</a> paper; these were marketed as notebooks to distinguish them from bulkier laptops.Regardless of the etymology, by the late 1990s, the terms were interchangeable.
</p>

